from collections import defaultdict

def solve():
    n = int(input())
    prefix = defaultdict(list)
    suffix = defaultdict(list)

    for i in range(2*n-2):
        s = input()
        prefix[len(s)].append(s)
        suffix[len(s)].append(s)

    ans = ['P'] * (2*n - 2)
    for i in range(1, n):
        for s in prefix[i]:
            if s in suffix[n-i]:
                ans[prefix[i].index(s)] = 'S'
                ans[suffix[n-i].index(s)] = 'S'

    print(''.join(ans))

t = 1
for _ in range(t):
    solve()
